import React from 'react';
import { Flex } from 'rebass';

import SiteHeader from '../../components/SiteHeader';

const Dashboard = () => {
    return (
        <Flex w={1} h={1} flexDirection='column'>
            <SiteHeader />
        </Flex>
    );
}

export default Dashboard;
